import React, { useState } from "react";
import { useParams, useNavigate, useLocation } from "react-router-dom";
import { SliderPicker } from "react-color";
import "./styles/NewsTemplate.css";

function NewsTemplate() {
	const navigate = useNavigate();
	const { flavor } = useParams();
	const [title, setTitle] = useState(
		flavor.charAt(0).toUpperCase() + flavor.slice(1)
	);
	const [unsavedChanges, setUnsavedChanges] = useState(false);
	const { state } = useLocation();
	const { preference } = state; // Read values passed on state
	const handleTitleChange = (event) => {
		setTitle(event.target.value);
		setUnsavedChanges(true);
	};

	const handleColorChange = (color) => {
		preference.color.hex = color.hex;
		setUnsavedChanges(true);
	};

	const handleSave = () => {
		console.log(preference);
		setUnsavedChanges(false);
		// Send preference to backend
	};

	return (
		<div className="news-template">
			<div className="button-wrapper">
				<button
					onClick={() => {
						navigate(-1);
					}}
				>
					Back
				</button>
			</div>
			<h1 className="title">Settings:</h1>
			<div className="preference-wrapper">
				<h2>
					<input
						type="text"
						className="editable-input title"
						value={title}
						onChange={handleTitleChange}
						style={{ color: preference.color.hex }}
					/>
					<hr className="editable-line" />
				</h2>
				<label>
					Personality:
					<input
						type="text"
						className="editable-input"
						value={preference.personality}
						onChange={(e) => (preference.personality = e.target.value)}
					/>
					<hr className="editable-line" />
				</label>
				<label>
					Topics:
					<input
						type="text"
						className="editable-input"
						value={preference.topics.join(", ")}
						onChange={(e) =>
							(preference.topics = e.target.value
								.split(",")
								.map((t) => t.trim()))
						}
					/>
					<hr className="editable-line" />
				</label>
				<label>
					Content Sources:
					<input
						type="text"
						className="editable-input"
						value={preference.contentSources.join(", ")}
						onChange={(e) =>
							(preference.contentSources = e.target.value
								.split(",")
								.map((s) => s.trim()))
						}
					/>
					<hr className="editable-line" />
				</label>
				<div className="color-picker">
					<div className="color-values-wrapper">
						<label className="color-label">Color:</label>
						<div className="color-values">
							<div className="color-hex">{preference.color.hex}</div>
						</div>
					</div>
					<div className="color-picker-container">
						<SliderPicker
							color={preference.color.hex}
							onChange={handleColorChange}
						/>
					</div>
				</div>
			</div>
			<div className="button-wrapper">
				<button onClick={handleSave} disabled={!unsavedChanges}>
					Save preference
				</button>
				{unsavedChanges && <span>Unsaved changes</span>}
			</div>
		</div>
	);
}

export default NewsTemplate;
